import './index.css';

import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';
import reportWebVitals from './reportWebVitals';

function Routing(){
  return(
    <Router>
      <Header/>
    <Routes>

      <Route path="/login" element={<Auth/>}>
      {console.log('show auth')}

      </Route>
    </Routes>
    <Footer/>
  </Router>
  )
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);

